INSERT INTO `el_qu` VALUES ('1344986367100215297',1,1,'以下哪一项最能表现某个项目的特征','2021-01-01 20:38:33','2021-01-01 20:38:33','',''),('1344987263271985153',1,1,'在软件开发过程中，软件结构设计是描述','2021-01-01 20:42:07','2021-01-01 20:42:07','','从工程管理角度来看，软件设计分两步完成：概要设计和详细设计。概要设计(又称结构设计 )将软件需求转化为软件体系结构、确定系统级接口、全局数据结构或数据库模式。'),('1344987562602684417',3,1,'测试是调试的一个部分','2021-01-01 20:43:18','2021-01-01 20:43:18','',''),('1344987722363723777',1,1,'软件测试类型按开发阶段划分是','2021-01-01 20:43:56','2021-01-01 20:43:56','',''),('1344988104301240321',2,1,'对于业务流清晰的系统可以利用	（  ）贯穿整个测试用例设计过程广在用例','2021-01-01 20:45:27','2021-01-01 20:45:27','',''),('1344988395562098689',1,1,'超出项目经理控制的成本增加因素，	除了存款利率、 贷款利息和税率外， 还包括（） ','2021-01-01 20:46:37','2021-01-01 20:46:37','',''),('1344988473395798018',2,1,'实施缺陷跟踪的I寸的是','2021-01-01 20:46:55','2021-01-01 20:46:55','',''),('1344988587686387714',1,1,'在深度为 5 的满二叉树中，叶子结点的个数为','2021-01-01 20:47:23','2021-01-01 20:47:23','','所谓满二叉树是指除最后一层外， 每层上的所有结点都有两个子结点。  也就是说，在满二叉树中，每一层上的结点数都达到最大值，即在满二叉树的第   K 层上有 2K-1 个结点，且深度为 m 的满二叉树有 2m 个结点。'),('1344988826078044162',2,1,'使用软件测试 丘具的口的','2021-01-01 20:48:19','2021-01-01 20:48:19','',''),('1344988850157543425',1,1,'已知二叉树 BT的后序遍历序列是 dabec，中序遍历序列是 debac，它的前序遍\n历序列是','2021-01-01 20:48:25','2021-01-01 20:48:25','','二叉树 BT的后序遍历序列为	dabec，故 BT的根结点为 c；而 BT的中序遍历序列是 debac，即遍历序列中最后一个结点为跟结点，	说明 BT的右子树为空。\n由BT的的后序遍历序列和中序遍历序列可知	BT的左子树 (LST的)	后序遍历序列和\n中序遍历序列分别为	dabe 和 deba(树是递归定义的 )：故 LST的根结点是 e，在由LST的中序遍历序列可知其左子树为	d。因此 BT的前序遍历序列为	cedba。'),('1344989027157172225',1,1,'下面程序的输出结果为 \n#include main()\n{\nchar pl[7]=	” abc”A,pB2C”[]=,st”r[50]=	“；xyz ”\nstrcpy(str,strcat(pl，p2))；\nprintf(	%“s”， str)；\n}\n','2021-01-01 20:49:07','2021-01-01 20:49:07','',' strcpy(strl，s1)：作用是将字符串 s1 拷贝到字符数组 strl 中去。strcat(字符数组 1，字符数组 2)：把。字符串 2 接到字符串 l 的后面，结果放在字符数组 1 中，函数调用后返回字符数组 l 的地址。\n本题定义了三个字符数组	pl,p2,str，strcat(p1,p2)函数的作用是将字符串数组		p2 接到字符串 p1 的后面，结果放在字符数组	p1，再通过 sffcpy()函数将该字符串拷贝到 str 数组中，原 str 数组中的字符串	xyz 被覆盖，因此打印输出字符串	str 即可得到 abcABC。'),('1344989227238055938',1,1,'项目管理需要在相互间有冲突的要求中